import React from 'react';

export default function About() {
  return (
    <div>
      <h1>About Sasha Doval</h1>
      <p>
        Sasha is a UCSD Coding Bootcamp student and amateur content creator. He has a bachelors degree in Liturature and Writing and is versed in HTML, CSS, JavaScript, SQL, Mongo, and React. 

      </p>
    </div>
  );
}
